  return (
    <ul>
      <li>
        <NavLink to="/" exact>
          Inicio
        </NavLink>
      </li>
      <li>
        <NavLink to="/especialidades">Especialidades</NavLink>
      </li>
      <li>
        <NavLink to="/cursos">Cursos</NavLink>
      </li>
      <li>
        <NavLink to="/profesores">Profesores</NavLink>
      </li>
      <li>
        <NavLink to="/notas">Notas</NavLink>
      </li>
      <li>
        <span onClick={() => removeToken()}>Cerrar Sesi√≥n</span>
      </li>
    </ul>
  );
};

